import './App.css';
import Navbar from './Components/Navbar/Navbar.js';
import Sale from './Components/Sale/Sale.js';
import Image from './Assets/img/as.jpg';
function App() {
  return (
  <div>
    <Navbar/>
    <Sale/>
    <div className="background-image">
    <img src={Image} alt="hy" />;
    </div>
  </div>
  );
}

export default App;
